<!DOCTYPE html>
<html>
  <head>
    <title>项目跟踪</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>

    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- Unnamed (Droplist) -->
      <div id="u5" class="ax_default droplist">
        <div id="u5_div" class=""></div>
        <select id="u5_input" class="u5_input">
          <option class="u5_input_option" value="项目名称">项目名称</option>
          <option class="u5_input_option" value="项目编号">项目编号</option>
          <option class="u5_input_option" value="客户名称">客户名称</option>
          <option class="u5_input_option" value="项目经理">项目经理</option>
          <option class="u5_input_option" value="业务类型">业务类型</option>
        </select>
      </div>

      <!-- Unnamed (Text Field) -->
      <div id="u6" class="ax_default text_field">
        <div id="u6_div" class=""></div>
        <input id="u6_input" type="text" value="" class="u6_input"/>
      </div>

      <!-- Unnamed (Checkbox) -->
      <div id="u7" class="ax_default checkbox selected">
        <label id="u7_input_label" for="u7_input" style="position: absolute; left: 0px;">
          <img id="u7_img" class="img " src="images/项目预算/u2_selected.svg"/>
          <div id="u7_text" class="text ">
            <p><span>渠道签署</span></p>
          </div>
        </label>
        <input id="u7_input" type="checkbox" value="checkbox"/>
      </div>

      <!-- Unnamed (Checkbox) -->
      <div id="u8" class="ax_default checkbox selected">
        <label id="u8_input_label" for="u8_input" style="position: absolute; left: 0px;">
          <img id="u8_img" class="img " src="images/项目预算/u3_selected.svg"/>
          <div id="u8_text" class="text ">
            <p><span>直接签署</span></p>
          </div>
        </label>
        <input id="u8_input" type="checkbox" value="checkbox"/>
      </div>

      <!-- Unnamed (Rectangle) -->
      <div id="u9" class="ax_default primary_button">
        <div id="u9_div" class=""></div>
        <div id="u9_text" class="text ">
          <p><span>查询</span></p>
        </div>
      </div>

      <!-- Unnamed (Checkbox) -->
      <div id="u10" class="ax_default checkbox selected">
        <label id="u10_input_label" for="u10_input" style="position: absolute; left: 0px;">
          <img id="u10_img" class="img " src="images/项目跟踪/u10_selected.svg"/>
          <div id="u10_text" class="text ">
            <p><span>立项</span></p>
          </div>
        </label>
        <input id="u10_input" type="checkbox" value="checkbox"/>
      </div>

      <!-- Unnamed (Checkbox) -->
      <div id="u11" class="ax_default checkbox">
        <label id="u11_input_label" for="u11_input" style="position: absolute; left: 0px;">
          <img id="u11_img" class="img " src="images/项目跟踪/u11.svg"/>
          <div id="u11_text" class="text ">
            <p><span>延期</span></p>
          </div>
        </label>
        <input id="u11_input" type="checkbox" value="checkbox"/>
      </div>

      <!-- Unnamed (Checkbox) -->
      <div id="u12" class="ax_default checkbox">
        <label id="u12_input_label" for="u12_input" style="position: absolute; left: 0px;">
          <img id="u12_img" class="img " src="images/项目跟踪/u12.svg"/>
          <div id="u12_text" class="text ">
            <p><span>结项</span></p>
          </div>
        </label>
        <input id="u12_input" type="checkbox" value="checkbox"/>
      </div>
    </div>
    <script src="resources/scripts/axure/ios.js"></script>

</html>
